def minion_game(string):

    if 0 < len(string) <= 10**6:

        def all_substrings(string):
            a = []
            for start in range(len(string)):
                for end in range(start + 1, len(string) + 1):
                    a.append(string[start:end])
            return a

        stu_arr = []
        kev_arr = []
        for substring in all_substrings(string):
            a = substring
            if a[0] == "A" or a[0] == "E" or a[0] == "I" or a[0] == "O" or a[0] == "U":
                kev_arr.append(a)
            else:
                stu_arr.append(a)

        if len(stu_arr) > len(kev_arr):
            print("Stuart" , len(stu_arr))
        else:
            print("Kevin" , len(kev_arr))
string = ""
minion_game(string)